const CustomRoute = ({
  component: Component,
  ...rest
}) => {
  const [redirect, setRedirect] = useState(false);

  

  return (
    <Route
      {...rest}
      render={(props) => <Component {...props} />}
    />
  );
};

export default CustomRoute;
